import React from 'react';
import "./members.css"
import {Member} from "../Data/members"

const Members = ()=>{
    return(
        <div className='memberCards'>
        {Member.map((members)=>{
            return(
        <div className='Members'>
            {members.names}
            {members.place}
        </div>
            )
        })}
        </div>

    )
}
export default Members
